import { List } from './Feedback.styled';

export const Feedback = ({ options, onLeaveFeedback }) => {
  return (
    <List>
      {options.map(option => (
        <button type="button" onClick={() => onLeaveFeedback('option')}>
          {option}
        </button>
      ))}
    </List>
  );
};
